import React from 'react';
import './GuestPage.css';

const GuestPage = () => {
  const rooms = [
    { id: 1, name: 'Room 1' },
    { id: 2, name: 'Room 2' },
    { id: 3, name: 'Room 3' },
    // Add more rooms as needed
  ];

  const handleJoin = (roomId) => {
    console.log(`Joining room ${roomId}`);
    // Implement the logic to join the room with the specified roomId
  };

  const handleLeave = (roomId) => {
    console.log(`Leaving room ${roomId}`);
    // Implement the logic to leave the room with the specified roomId
  };

  return (
    <div className="GuestChatContainer">
      <div className="roomColumn">
        <h3>Current Rooms</h3>
        <div className="chatRoomCSS">
          {rooms.map((room) => (
            <div key={room.id}>
              {room.name} -&gt;
              <button className="chatRoomButton" onClick={() => handleJoin(room.id)}>
                Join
              </button>
              <button className="chatRoomButton" onClick={() => handleLeave(room.id)}>
                Leave
              </button>
            </div>
          ))}
        </div>
      </div>
      <div className="chatColumn">Current Chat</div>
      <div className="userColumn">Current Online</div>
    </div>
  );
};

export default GuestPage;
